insert into thesaurus_property (property_source_id, property_text, property_type, property_language) values((select id from thesaurus_resource where uri = 'T0013858'), 'لأوضاع التي يعيش فيها اللاجئون أمدا طويلا ولا يكونون فيها معرضين للخطر، إلا أنهم يحرمون فيها من حقوقهم الأساسية ومن تلبية احتياجاتهم الاقتصادية والاجتماعية والنفسية بعد السنوات التي قضوها في  المنفى ولا يكون في مقدروهم التخلص من الاعتماد الاضطراري على المساعدة الخارجية', 'skos:scopeNote', 'ar');
insert into thesaurus_property (property_source_id, property_text, property_type, property_language) values((select id from thesaurus_resource where uri = 'T0013858'), 'Long-lasting, intractable situations where refugees'' lives may not be at risk but their basic rights and essential economic, social and psychological needs remain unfulfilled after years in exile and they are unable to break free from enforced reliance on external assistance', 'skos:scopeNote', 'en');
insert into thesaurus_property (property_source_id, property_text, property_type, property_language) values((select id from thesaurus_resource where uri = 'T0013858'), 'Réfugiés de longue durée dont la situation irrésolue se prolonge,leur vie peut ne plus être en danger, mais leurs droits fondamentaux et leurs besoins économiques, sociaux et culturels de base ne sont pas satisfaits', 'skos:scopeNote', 'fr');
insert into thesaurus_property (property_source_id, property_text, property_type, property_language) values((select id from thesaurus_resource where uri = 'T0013858'), 'Протяжительное проживание в изгнании, когда жизнь беженцев не подвергается опасности, но их основные права и насущные экономические, социальные и психологические нужды остаются не восполненными на протяжении всех лет в изгнании,при которых беженцы, к тому же, не имеют практических возможностей вырваться из плена вынужденной зависимости от внешней помощи', 'skos:scopeNote', 'ru');
insert into thesaurus_property (property_source_id, property_text, property_type, property_language) values((select id from thesaurus_resource where uri = 'T0013858'), 'Las situaciones difíciles, de larga duración, donde la vida de los refugiados no está necesariamente en riesgo, pero sus derechos básicos y sus necesidades económicas, sociales y psicológicas siguen sin ser cubiertas después de años de exilio, y estos son incapaces de sobrevivir sin asistencia externa', 'skos:scopeNote', 'es');
